desc:
ဂျာမနီနိုင်ငံ ဘာလင်မြို့ရှိ မြန်မာသံရုံးရှေ့ ၌ ဆွဲထားသော ဒေါ်အောင်ဆန်းစုကြည်ပုံနှင့် civil disobedience movement ကိုထောက်ခံသော ပုံကိုဆွဲထားသည့် graffiti အား သံအမတ်ကြီး ဒေါ်ယဉ်ယဉ်မြင့်မှ သူမ၏၀န်ထမ်းအားထို graffiti ပုံကို အမဲ‌ရောင်ဆေးဖြင့်ဖုံးကာ ဖျက်စေခဲ့သည်။ နှစ်ငါးဆယ်အတွင်းမြန်မာနိုင်ငံ၏ပထမဆုံးအမျိုးသမီး ambassador ဖြစ်ခဲ့သော သံအမတ်ကြီးဒေါ်ယဉ်ယဉ်မြင့်သည် ပြည်သူများဘက်မှ မရပ်တည်ဘဲ စစ်အစိုးရဘက်မှ ရပ်တည်နေသည်ကို ကျနော်/ကျမတို့ ကျောင်းသား/ကျောင်းသူများမှ ရှုံ့ချပါသည်။

